    true(mshare([[A],[A,S1],[A,S1,B,S2,S],[A,S1,B,S],[A,S1,S2],[A,S1,S2,S],[A,S1,S],[A,B,S2,S],[A,B,S],[A,S2],[A,S2,S],[S1],[S1,B,S2,S],[S1,B,S],[S1,S2],[S1,S2,S],[S1,S],[B,S2,S],[B,S],[S2],[S2,S]])).
unionv_3(=,A,S1,_1,S2,[A|S]) :-
    true((
        mshare([[A],[A,S1],[A,S1,_1],[A,S1,_1,S2],[A,S1,S2],[A,_1],[A,_1,S2],[A,S2],[S1],[S1,_1],[S1,_1,S2],[S1,S2],[_1],[_1,S2],[S2],[S]]),
        var(S),
