subsetv([],_1).
subsetv([A|S1],[B|S2]) :-
    compare(Order,A,B),
    subsetv_2(Order,A,S1,S2).

subsetv_2(=,_1,S1,S2) :-
    subsetv(S1,S2).
subsetv_2(>,A,S1,S2) :-
    subsetv([A|S1],S2).

small_subsetv([],_1).
small_subsetv([A|S1],S2) :-
    inv(A,S2),
    small_subsetv(S1,S2).

:- true pred inv(A,_A)
   : ( mshare([[A],[A,_A],[_A]]),
       linear(A) )
   => mshare([[A],[A,_A],[_A]]).

:- true pred inv(A,_A)
   : mshare([[A],[A,_A],[_A]])
   => mshare([[A],[A,_A],[_A]]).

inv(A,[B|S]) :-
    true((mshare([[A],[A,B],[A,B,S],[A,S],[B],[B,S],[S],[Order]]),var(Order),linear(A),linear(Order);mshare([[A],[A,B],[A,B,S],[A,S],[B],[B,S],[S],[Order]]),var(Order),linear(Order))),
    compare(Order,A,B),
    true((
        mshare([[A],[A,B],[A,B,S],[A,S],[B],[B,S],[S]]),
        ground([Order])
    )),
    inv_2(Order,A,S),
    true((
        mshare([[A],[A,B],[A,B,S],[A,S],[B],[B,S],[S]]),
        ground([Order])
    )).

:- true pred inv_2(_A,_1,_2)
   : ( mshare([[_1],[_1,_2],[_2]]),
       ground([_A]) )
   => ( mshare([[_1],[_1,_2],[_2]]),
        ground([_A]) ).

inv_2(=,_1,_2).
