notinv(A,S) :-
    true((mshare([[A],[A,S],[S]]);mshare([[A],[A,S],[S]]),linear(A))),
    notinv_2(S,A),
    true(mshare([[A],[A,S],[S]])).

:- true pred notinv_2(_A,_1)
