:- true pred notinv_3(_A,_1,_2)
   : ( mshare([[_1],[_1,_2],[_2]]),
       ground([_A]) )
   => ( mshare([[_1],[_1,_2],[_2]]),
        ground([_A]) ).

notinv_3(<,_1,_2).
notinv_3(>,A,S) :-
    true(mshare([[A],[A,S],[S]])),
    notinv_2(S,A),
    true(mshare([[A],[A,S],[S]])).


